# Closures are a fundamental topic in javascript

An example of a closure is as follows:
```js
function add(a, b) {
  if (b) return a + b;

  return function(b) {
    return a + b;
  }
}

add(2, 3) // 5
add(2)(3) // 5
```

They are very powerful, and to explain I will give a simple example

Imaging you want to create a counter, so you do it like so:

```js
class Counter {
  constructor() {
    this.value = 0;
  }

  count() {
    this.value++;
  }
}

const counter = new Counter();

counter.count();
counter.count();
counter.count();

counter.value; // 3
```

But that is boring, we want a simple function to return a counter. So you go back to the drawing board, and come up with this function:

```js
let count = 0;
function counter() {
  return ++count;
}

counter();
counter();

count; // 2
```

But count is a global variable, and we want the `counter()` to return a new counter, which isnt the case. So you decide, hey! Why dont I just wrap the `counter()` function in another one so i can just return it, and that is exactly what you do

```js
function counter() {
  let count = 0;
  return function count() {
    return ++count;
  }
}

const count1 = counter();
const count2 = counter();

count1(); // 1
count1(); // 2

count2(); // 1
```

Yay! It Works

Basically, a closure is when a function is returned by another function

In es6 syntax that would look like

```js
const counter = () => {
  let count = 0;
  return () => ++count;
}
```

which is more concise `(please learn es6)`

The reason why closures and why they are so powerful is because of javascript scoping. by default javascript is function scoped, meaning the following code breaks:

```js
function counter() {
  let count = 0;
}

console.log(count) // error, count is not defined
```

Thats also why most closures are `pure functions` but dont worry about that now.

Another example of a closure (advanced)  is the following:

```js
const expand = (f, n) => {
  const rec = (...args) =>
    args.length >= n ? f(...args)
      : (...args2) => rec(...args, ...args2)
  return rec;
}

const count = (...nums) => nums.reduce((a, b) => a + b, 0);

const add4 = expand(count, 4);

add4(1, 1, 1, 1) // 4
add4(1, 2, 3, 4) // 10
add4(1)()()()(2, 3)()(4) // 10
add4(1)(2)(3)(4) // 10
```

